import React from 'react';
import { motion } from 'framer-motion';
import { useInView } from 'react-intersection-observer';
import { FiGraduationCap, FiBook, FiTarget } from 'react-icons/fi';
import './About.css';

const About = () => {
  const [ref, inView] = useInView({
    threshold: 0.3,
    triggerOnce: true
  });

  const highlights = [
    {
      icon: <FiGraduationCap size={24} />,
      title: "Postgraduate Student",
      description: "MCA (AI & ML) at Lovely Professional University"
    },
    {
      icon: <FiBook size={24} />,
      title: "Business Foundation",
      description: "BBA in Finance & Marketing from Shree Medha Degree College"
    },
    {
      icon: <FiTarget size={24} />,
      title: "AI/ML Specialist",
      description: "Passionate about solving real-world problems through ML, NLP, and AI systems"
    }
  ];

  return (
    <section id="about" className="about section" ref={ref}>
      <div className="container">
        <motion.div
          className="section-header"
          initial={{ opacity: 0, y: 30 }}
          animate={inView ? { opacity: 1, y: 0 } : {}}
          transition={{ duration: 0.6 }}
        >
          <h2>About Me</h2>
          <p className="section-subtitle">
            Bridging business insights with artificial intelligence
          </p>
        </motion.div>

        <div className="about-content">
          <motion.div
            className="about-text"
            initial={{ opacity: 0, x: -50 }}
            animate={inView ? { opacity: 1, x: 0 } : {}}
            transition={{ duration: 0.8, delay: 0.2 }}
          >
            <div className="about-description">
              <p>
                I'm a postgraduate student specializing in <strong>Artificial Intelligence and Machine Learning</strong> at <strong>Lovely Professional University</strong>, with a strong foundation in business (BBA - Finance & Marketing). I'm passionate about solving real-world problems through ML, NLP, and AI systems.
              </p>
              <p>
                From deep learning models to real-time audio surveillance, I combine data science principles with a human-centered mindset. My journey from business to AI has given me a unique perspective on how technology can drive meaningful business outcomes.
              </p>
              <p>
                I believe in building intelligent, context-aware systems that not only perform well technically but also create real value for users and organizations.
              </p>
            </div>

            <div className="about-highlights">
              {highlights.map((highlight, index) => (
                <motion.div
                  key={index}
                  className="highlight-item"
                  initial={{ opacity: 0, y: 20 }}
                  animate={inView ? { opacity: 1, y: 0 } : {}}
                  transition={{ duration: 0.6, delay: 0.4 + index * 0.1 }}
                >
                  <div className="highlight-icon">
                    {highlight.icon}
                  </div>
                  <div className="highlight-content">
                    <h4>{highlight.title}</h4>
                    <p>{highlight.description}</p>
                  </div>
                </motion.div>
              ))}
            </div>
          </motion.div>

          <motion.div
            className="about-image"
            initial={{ opacity: 0, x: 50 }}
            animate={inView ? { opacity: 1, x: 0 } : {}}
            transition={{ duration: 0.8, delay: 0.4 }}
          >
            <div className="image-container">
              <div className="profile-image">
                {/* Placeholder for about image */}
                <div className="image-placeholder">
                  <span>GK</span>
                </div>
              </div>
              <div className="image-decoration"></div>
            </div>
          </motion.div>
        </div>

        <motion.div
          className="about-stats"
          initial={{ opacity: 0, y: 30 }}
          animate={inView ? { opacity: 1, y: 0 } : {}}
          transition={{ duration: 0.8, delay: 0.6 }}
        >
          <div className="stats-grid">
            <div className="stat-item">
              <h3>6+</h3>
              <p>AI/ML Projects</p>
            </div>
            <div className="stat-item">
              <h3>3+</h3>
              <p>Certifications</p>
            </div>
            <div className="stat-item">
              <h3>2+</h3>
              <p>Years Experience</p>
            </div>
            <div className="stat-item">
              <h3>100%</h3>
              <p>Project Success</p>
            </div>
          </div>
        </motion.div>
      </div>
    </section>
  );
};

export default About;
